import { useState } from 'react'
import Header from './components/Header';
import Events from './components/Events';
import { Event } from './models/event';

interface props {
  events?: Event;
  id: number;
  text: string;
  date: string;
}

const App: React.FC<props> = ({events, id, text, date}) => {

  const [list, setList] = useState<Event[]>([
    {
        id: 1,
        text: 'Example 1',
        date: '01/02/2023'    
    },
    {
        id: 2,
        text: 'Example 2',
        date: '01/03/2023'    
    },
    {
        id: 3,
        text: 'Example 3',
        date: '01/24/2023'    
    }
])

  return (
    <div className="App">
      <Header />
      <Events 
        id={id} 
        text={text} 
        date={date} 
        events={list}
        />
    </div>
  );
}

export default App;
